import React from "react";
import './Gallery.css'
  
class Gallery extends React.Component {
  constructor(props) {
    super(props);
    this.state = { text: "Welcome to gallery!" };
  }
  
  componentWillMount() {
    
  }
  
  render() {
    return <div>
            <h1>{this.state.text}</h1>;
          </div>
  }
}
  
export default Gallery;
